CREATE TABLE `shop_trade_details` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `biz_info_id` int(11) DEFAULT NULL COMMENT '商铺',
  `master` int(11) DEFAULT NULL COMMENT '现有店主',
  `buyer` int(11) DEFAULT NULL COMMENT '买家',
  `amount` int(11) DEFAULT NULL COMMENT '店铺金额',
  `is_freeze` int(11) DEFAULT NULL COMMENT '金额是否已冻结 0 未冻结  1冻结',
  `result` int(11) DEFAULT NULL COMMENT '是否成交  0 确认中 1 成交  2 交易失败',
  `created_on` datetime DEFAULT NULL COMMENT '交易发起时间',
  `wite_time` int(11) DEFAULT NULL COMMENT '等待时间，从交易时间开始算，超过这个时间，就放弃此交易,单位为天',
  `success_date` datetime DEFAULT NULL COMMENT '成交时间交易失败时间、放弃交易时间',
  `biz_score` int(11) DEFAULT '500' COMMENT '交易时店铺积分',
  PRIMARY KEY (`id`),
  KEY `buyer_index` (`buyer`),
  KEY `biz_result_key` (`biz_info_id`,`result`),
  KEY `amount_key` (`amount`),
  KEY `created_on_key` (`created_on`)
) ENGINE=InnoDB AUTO_INCREMENT=56444 DEFAULT CHARSET=utf8 COMMENT='有东家店铺买卖交易明细';
